complete_model_interaction.output:
Below is the step‐by‐step reasoning and the final model specification.

Step‐by‐step reasoning:
1. Key psychological mechanisms: In the ultimatum game, responders compare the offered amount (their actual split) to what they perceive as “fair” or expected from the environment. In the Fehr–Schmidt formulation, unfairness (envy) reduces the utility of an accepted offer if the offer is lower than the fairness expectation. In this modified version the fairness norm is not fixed but is learned from the offers experienced over time.
2. How they interact: The perceived fairness (denoted here as F) is updated trial‐by‐trial by comparing the “fair” percentage the participant expected to get with the actual percentage offered (i.e. split_self divided by combined_earning). The utility for accepting in a trial is the monetary offer minus a penalty if the accepted share falls short of the current fairness norm.
3. Mathematical form: The utility of accepting in a particular trial is given by
  U_accept = split_self − α · max(combined_earning × F − split_self, 0)
where α (alpha) represents the weight of inequity aversion and F is the learned fairness estimate (ranging between 0 and 1).  
4. Parameters: There are two learnable parameters. The first is α (alpha), governing the reduction in utility when the accepted offer is lower than the expected fair share. The second is the learning rate, lr, determining how quickly the fairness estimate F is updated from the observed offer proportions. Initiation of F is set at 0.5.
5. Linking to data: The observable variables from the dataset that are used in this model are split_self (the offered amount to the participant) and combined_earning (the total money for that trial). These allow the calculation of the observed offer proportion (split_self/combined_earning), which is used to update F. The model calculates the utility of accepting an offer on each trial so that negative utilities indicate strong rejections of unfair offers.

Below is the formal specification:

<MODEL>
For trial t, the utility of accepting the offer is given by:
  U_accept(t) = split_self(t) − alpha * max( combined_earning(t) * fairness(t) − split_self(t) , 0 )
The fairness estimate is updated across trials as:
  fairness(t+1) = fairness(t) + learning_rate * [ (split_self(t) / combined_earning(t)) − fairness(t) ]
with the initial fairness estimate set at:
  fairness(1) = 0.5
</MODEL>

<VARIABLES>
