        "inclusive_max": true
      },
      "learnable": true,
      "source": "learnable"
    },
    "learning_rate": {
      "description": "Learning rate that governs the update of the fairness estimate from trial to trial. It determines how much weight is given to the difference between the observed offer proportion and the current fairness estimate.",
      "range": {
        "min": 0.0,
        "max": 1.0,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": true,
      "source": "learnable"
    },
    "fairness": {
      "description": "The current learned fairness estimate (i.e., the proportion of the combined earning the participant expects to receive). It is updated on each trial using the observed proportion (split_self/combined_earning).",
      "range": {
        "min": 0.0,
