A modified Fehr–Schmidt model for the ultimatum game where responders compute the utility of accepting an offer as the monetary share received minus a penalty for falling below a learned fairness norm. The fairness norm is dynamically updated via a simple delta learning rule with an initial value of 0.5. The model uses two learnable parameters: alpha, which scales the disutility of receiving less than the anticipated fair share, and the learning_rate, which determines the speed of updating the fairness expectation.
</SUMMARY>

